import styled from 'styled-components'
import Illustration from './Illustration.js';
import hic from './img/hic.jpg';
// import {BrowserRouter, Switch, Route,} from "react-router-dom";

function Illustrations() {
  return (
    <div
    style={{  
        display: "flex",
        justifyContent: "space-around",
        }}>
     <Illustration src={hic}/>
     <Illustration src={hic}/>
     <Illustration src={hic}/>
     <Illustration src={hic}/>
     <Illustration src="./bluebeard.jpg"/>
     <Illustration src="./motionwaitdadwasginger?.jpg"/>
     <Illustration src="./noodles.jpg"/>
     <Illustration src="./99s05carti.jpg"/>
     <Illustration src="./motionframesofmind.jpg"/>
    </div>

  );
}

export default Illustrations;
